import React from 'react';

const Contact =()=>{
return( 
    <div className="contact">
<form>
  NAME:<br></br>
  <input type="text" name="name" required></input><br></br>
  COMPANY:<br></br>
  <input type="text" name="company"></input><br></br>
  E-MAIL:<br></br>
  <input type="text" name="e-mail"></input><br></br>
  <input type="textfield"></input>
  <button type="submit"></button>
</form>
    </div>
    )
}

export default Contact;
